void derivs_of_Electricity(double *x, double *u, double *dxdt)
{
  double del1 = x[0];
  double omg1 = x[1];
  double del2 = x[2];
  double omg2 = x[3];
  double pm1 = u[0];
  double pm2 = u[1];

  dxdt[0] = 4.3478260869565215*omg1;
  dxdt[1] = 4.3478260869565215*(0. - 0.05*omg1 + pm1 - Sin(del1) - 0.5*Sin(del1 - del2));
  dxdt[2] = 4.3478260869565215*omg2;
  dxdt[3] = 4.3478260869565215*(-0.05*omg2 + pm2 + 0.5*Sin(del1 - del2) - Sin(del2));
}

void derivs_of_Heat(double *x, double *u, double *dxdt)
{
  double p1 = x[0];
  double p2 = x[1];
  double w = x[2];
  double Q1 = u[0];
  double Q2 = u[1];
  
  dxdt[0] = 0.06477732793522267*(-2 + Q1 - 8.360092210467801*w);
  dxdt[1] = 0.06477732793522267*(-5 + Q2 + 8.360092210467801*w);
  dxdt[2] = 0.15625*(1.*(p1 - p2) - 8.*Power(w,2));
}

void derivs_of_GasTurbine(double *x, double *u, double *dxdt)
{
  double x1 = x[0];
  double x2 = x[1];
  double x3 = x[2];
  double x4 = x[3];
  double x5 = x[4];
  double x6 = x[5];
  double u1 = u[0];
  double u2 = u[1];
  
  dxdt[0] = 20.*(0.23 + 0.77*u1 - x1);
  dxdt[1] = 2.5*(x1 - x2);
  dxdt[2] = 10.*(x2 - x3);
  dxdt[3] = 20.*(0.23 + 0.77*u2 - x4);
  dxdt[4] = 2.5*(x4 - x5);
  dxdt[5] = 10.*(x5 - x6);

}

void output_of_GasTurbine(double *x, double *pm, double *q)
{
  double x1 = x[0];
  double x2 = x[1];
  double x3 = x[2];
  double x4 = x[3];
  double x5 = x[4];
  double x6 = x[5];

  pm[0] = 1.948051948051948*(-0.23 + x3);
  pm[1] = 0.7792207792207791*(-0.23 + x6); 
  q[0] =  6*x2;
  q[1] =  6*x5; 
}

void two_site_system(double *x, double *u, double *dxdt)
{
  double x1 = x[0];
  double x2 = x[1];
  double x3 = x[2];
  double x4 = x[3];
  double x5 = x[4];
  double x6 = x[5];
  double x7 = x[6];
  double x8 = x[7];
  double x9 = x[8];
  double x10 = x[9];
  double x11 = x[10];
  double x12 = x[11];
  double x13 = x[12];
  double u1  = u[0];
  double u2  = u[1];
  
  dxdt[0]  = 15.4*u1 + 20.*(0.23 - x1);
  dxdt[1]  = 2.5*(x1 - x2);
  dxdt[2]  = 10.*(x2 - x3);
  dxdt[3]  = 15.4*u2 + 20.*(0.23 - x4);
  dxdt[4]  = 2.5*(x4 - x5);
  dxdt[5]  = 10.*(x5 - x6);
  dxdt[6]  = 4.3478260869565215*x8;
  dxdt[7]  = 4.3478260869565215*(0. + 1.948051948051948*(-0.23 + x3) - 0.05*x8 - Sin(x7) - 0.5*Sin(x7 - x9));
  dxdt[8]  = 4.3478260869565215*x10;
  dxdt[9]  = 4.3478260869565215*(-0.05*x10 + 0.7792207792207791*(-0.23 + x6) + 0.5*Sin(x7 - x9) - Sin(x9));
  dxdt[10] = 0.06477732793522267*(-2 - 8.360092210467801*x13 + 6*x2);
  dxdt[11] = 0.06477732793522267*(-5 + 8.360092210467801*x13 + 6*x5);
  dxdt[12] = 0.15625*(1.*(x11 - x12) - 8.*Power(x13,2));
}

// for staedy flow calculation

void equil_xe(double *u, double *xe, double *dxedt)
{
  double u1 = u[0];
  double u2 = u[1];
  double del1 = xe[0];
  double del2 = xe[1];
  dxedt[0] = 4.3478260869565215*(0. + 1.5*u1 - Sin(del1) - 0.5*Sin(del1 - del2));
  dxedt[1] = 4.3478260869565215*(0.6*u2 + 0.5*Sin(del1 - del2) - Sin(del2));
}

void equil_xh(double *u, double *xh, double *dxhdt)
{
  double u1 = u[0];
  double u2 = u[1];
  double w    = xh[0];
  double delP = xh[1]; 
  dxhdt[0] = 0.06477732793522267*(-2 + 6*(0.23 + 0.77*u1) - 8.360092210467801*w) - 0.06477732793522267*(-5 + 6*(0.23 + 0.77*u2) + 8.360092210467801*w);
  dxhdt[1] = 0.15625*(1.*delP - 8.*Power(w,2));
}

void steady_flow_value(double *xe, double *xh, double *flow)
{
  double del1 = xe[0];
  double del2 = xe[1];
  double w    = xh[0];
  double delP = xh[1]; 
  flow[0] = Sin(del1) + Sin(del2);
  flow[1] = 8.360092210467801*w;
}


